DELIMITER $$
CREATE TRIGGER `item_pedido_after_insert` AFTER INSERT ON `item_pedido`
 FOR EACH ROW BEGIN
	update pedido p set p.valor_total = ifnull (p.valor_total,0) + (new.valor_unitario * new.quantidade)
	where p.codigo_pedido = new.codigo_pedidoCardapio;
END
$$
DELIMITER ;

